        style={[styles.rectanglePressable, styles.rectanglePressableLayout]}
        onPress={() => navigation.navigate("AndroidSmall16")}
      />
      <Text style={[styles.productName, styles.productFlexBox]}>
        product name
      </Text>
      <Image
        style={[styles.ellipseIcon, styles.ellipseIconLayout]}
