      <Pressable
        style={[styles.androidSmall4Child5, styles.androidChildPosition]}
        onPress={() => navigation.navigate("AndroidSmall16")}
      />
      <Text style={[styles.productName3, styles.productFlexBox]}>
        product name
      </Text>
      <Image
        style={styles.androidSmall4Child6}
        contentFit="cover"
        source={require("../assets/ellipse-16.png")}
