      <Text style={[styles.allInventory, styles.productFlexBox]}>
        All Inventory
      </Text>
      <Pressable
        style={styles.androidSmall4Child7}
        onPress={() => navigation.navigate("AndroidSmall2")}
      />
      <Text style={[styles.home, styles.productFlexBox]}>Home</Text>
    </View>
  );
};

